import React, { Component } from "react";
import { connect } from "react-redux";
import Dialog from "./Dialog";
import Footer from "./Footer";
import * as quiers from "./../actions/queries";

class Users extends Component {
  componentWillMount() {
    // console.log("id", this.getMembers());
  }

  async getMembers() {
    // console.log("id", this.props.userId);
    // if (this.props.userId) await this.props.getMembers(this.props.userId);
  }

  render() {
    console.log("member", this.props.member);
    return (
      <div>
        <div className="container">
          <h1>Currently memebers</h1>

          {/* {this.props.members.map(member => (
            <div>
              <label> {member.email} </label>
              <label> {member.first_name} </label>
            </div>
          ))} */}
        </div>
      </div>
    );
  }
}

Users.propTypes = {};

function mapDispatchToProps(dispatch) {
  return {
    getMembers: () => dispatch(quiers.getMembers())
  };
}

// export default Users;

function mapStateToProps(state) {
  return {
    members: state.user.allMembers
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Users);
